import React from 'react';
import '../styles/components/Header.css';
import logo from './assets/logo-TaskWeek.png';

function Header() {
  return (
    <header className="header">
      <img src={logo} alt="Logo Taskweek" className="logo" />
    </header>
  );
}

export default Header;
